import androidVersionSvg from '../public/media/undraw_android_jr64.svg';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {faAndroid} from '@fortawesome/free-brands-svg-icons/faAndroid';

const DownloadApp = () => {

    return (
        <section className="mt-5">
            <div className="container shadow-lg py-5 px-5 rounded-section my-4">
                <h2 className="display-4 text-center mb-lg-4  mb-4">التحميل</h2>
                <div className="row">
                    <div className="col-6">
                        <h4 className="text-center">حمل تطبيق الاندرويد</h4>
                        <img src={androidVersionSvg} className="w-75"/>
                        <div className="d-flex flex-row align-items-center">
                            <button className="btn btn-primary">
                                <span>تحميل</span>
                                <FontAwesomeIcon icon={faAndroid}/>
                            </button>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    )
};


export default DownloadApp;
